// Verificar erros no console
const logs = [];
const errors = document.querySelectorAll('.error');
if (window.console && window.console.error) {
  logs.push('Console errors check');
}
// Verificar se React estÃ¡ carregado
if (window.React) {
  logs.push('React: Loaded');
} else {
  logs.push('React: Not loaded');
}
// Verificar elemento root
const root = document.getElementById('root');
if (root) {
  logs.push(`Root element: Found, innerHTML length: ${root.innerHTML.length}`);
} else {
  logs.push('Root element: Not found');
}
logs.join('\n');

// Capturar todos os logs do console
const logs = [];

// Verificar erros de rede
const performanceEntries = performance.getEntriesByType('resource');
const failedResources = performanceEntries.filter(entry => entry.responseEnd === 0);
if (failedResources.length > 0) {
  logs.push(`Failed resources: ${failedResources.map(r => r.name).join(', ')}`);
}

// Verificar se hÃ¡ erros no window
if (window.error) {
  logs.push(`Window error: ${window.error}`);
}

// Verificar o documento
logs.push(`Document state: ${document.readyState}`);
logs.push(`Body children: ${document.body.children.length}`);
logs.push(`Root element: ${document.getElementById('root') ? 'exists' : 'missing'}`);

// Verificar scripts carregados
const scripts = Array.from(document.querySelectorAll('script'));
logs.push(`Scripts loaded: ${scripts.length}`);
scripts.forEach(script => {
  logs.push(`Script: ${script.src || 'inline'}`);
});

return logs.join('\n');

